import React from "react";

class Section extends React.Component {
  render() {
    return (
      <div className="section">
        <div className="section-content" id={this.props.id}>
          <h1>{this.props.title}</h1>
          <p>{this.props.subtitle}</p>
        </div>
      </div>
    );
  }
} 
